import './PokemonCard.css'

export default function PokemonCard({ pokemon }) {
  console.log(pokemon.key)
  return (
    <article className='PokemonCard'>
      <p>id: {pokemon.key}</p>
      <p>name: {pokemon.name && pokemon.name != null && pokemon.name !== undefined ? pokemon.name
        : "unknown"}</p>
      <button>Catch</button>
    </article>
  )
}
